import './App.css';
import ModalPersona from './ModalPersona.js'
import Button from '@material-ui/core/Button';
import Card from '@material-ui/core/Card';
import Header from './Header.js'
import React from 'react';
import Divider from '@material-ui/core/Divider';
import Table from '@material-ui/core/Table';


/* 
  --Dudas--
  Donde poner el divider
*/


const a = <Button>afsfsa</Button>

function App() {

  /* Props que recibe, iría en el story y despues agregar arriba en App({}) */
  const content = "adasa";
  const buttonProps = {
    text:"Designar Persona",
    variant:"outlined",
    color:"secondary",
    disabled:true,
    clickHandle: alertar => (alert('Boton Final Clickeado')),
  }
  /* Fin Props */

  const [open, setOpen] = React.useState(false);
  const handleClose = () => setOpen(false);
  const handleClick = () => setOpen(true);

  return (
    <div>
      <div className="cardCointainer">
        <Card className="card">
          <Header title="Datos de persona*" linkText="+Asignar Persona" handleClick={handleClick} />
          <Divider variant="middle" />
          { content &&
            <div className="cardContent">
              {content}
            </div>
          }
          { buttonProps && 
            <div className="cardButton">
              <Button variant={buttonProps.variant} color={buttonProps.color} onClick={buttonProps.clickHandle}>
                {buttonProps.text}
              </Button>
            </div>
          }
        </Card>
        {a}
      </div>
      <ModalPersona open={open} handleClose={handleClose}></ModalPersona>
    </div>
  );
}

export default App;
